import React from 'react';

class TimeContainer extends React.Component {
    constructor(props) {
    super(props);
    let newDate = new Date();
    this.state = {
    date: newDate.getDate(),
     currentMonth: newDate.getMonth(), 
     currentYear: newDate.getFullYear()
    }
}


} 

export default TimeContainer;
